import {React, useState, useEffect} from 'react';
import * as __data from "./searchListData"
import * as style from "../../css/light/searchList";
// import FocusedList from './focusedList';
import getItem from './getItem';
import getTotalCount from './getTotalCount';
import getDeviceData from "./getDeviceData";
import getUserData from "./getUserData";
import getDidData from "./getDidData";
import getSearch from './getSearch';
import getFilteredSearch from './getFilteredSearch';
import ItemList from "./itemList"
import Total from "./total"
import ProfileButtons from "./profileButtons"

let filteredSearch = {
  "device": {"results": getDeviceData, "relevant": "mac"}, 
  "user": {"results": getUserData, "relevant": "id"},
  "did": {"results": getDidData, "relevant": "did"}
}

export default function SearchList() {
  const [data, setData] = useState(__data['default'])
  const [item, setItem] = useState(getItem(filteredSearch))
  // const [focused, setFocused] = useState([])
  const [pageNumber, setPageNumber] = useState(10)
  const [tempItem, setTempItem] = useState("")
  const [listToRender, setListToRender] = useState(["DID", "Device", "User", "Line", "Voicemail", "rendom"])
  
  useEffect(() => {
    setData(getTotalCount(filteredSearch, data))
  }, [data])

  const handleInputChange = string => {
    let search = getSearch(getDeviceData, getUserData, getDidData, string, filteredSearch)
    filteredSearch = getFilteredSearch(search)
    setItem(getItem(filteredSearch))
    setData(getTotalCount(filteredSearch, data))
  }

  // const handleFocus = (e, type, id, assoc) => {
  //   if (e.target.style.cursor !== "pointer") return
  //   for (let i in focused) if (e.target.innerHTML === focused[i][0].resources[0].data[id]) return
  //   let newFocused = [[require(`../../data/${type}/${e.nativeEvent.path[1].innerText.split('\n')[0]}.json`), id, type, assoc], ...newFocused]
  //   setFocused(newFocused)
  // }

  const getItemsToRender = () => {
    let temp = {}

    for (let i in listToRender) {
      if (!item[listToRender[i].toLowerCase()]) {/*pass*/}
      else temp[listToRender[i].toLowerCase()] = item[listToRender[i].toLowerCase()]
    }
    return temp
  }
    
  return (
    <div style={{maxWidth: "63.5vw"}}>
      <ProfileButtons temp={filteredSearch} listToRender={listToRender} setListToRender={setListToRender}></ProfileButtons>
      <input style={style.searchInputStyle} onChange={e => handleInputChange(e)}/>
      <ItemList temp={getItemsToRender()} data={data} item={item} pageNumber={pageNumber} filteredSearch={filteredSearch}/>
      <Total tempItem={tempItem} pageNumber={pageNumber} setTempItem={setTempItem} setPageNumber={setPageNumber} profile={item} listToRender={listToRender}/>
    </div>
    // <FocusedList focused={focused} setTempItem={setTempItem} setFocused={setFocused} data={data} item={item} filteredSearch={filteredSearch}/>
  );
};
